import { useLocation } from 'react-router-dom'
//scss
import styles from './HomePage.module.scss'

const Homepage = () => {
    const url = useLocation();
    console.log(url);

    return (
        <header>
            <div className={ styles.logo}>
                <span>J. Merta</span>
            </div>
        </header>
    );
}

export default Homepage;
